  02> LUDBROOK, Anna Jeanne
  b 13.07.1977
  Anna b. at Sydney, Australia. She attended Nga Tawa School, Marton and in 1996 she spent a year in
  the UK as a matron at Bramcote School in Scarborough. She has spent 1997 at Massey University
  studying towards a BA in Education and Child Psychology before returning to the UK.
  03> LUDBROOK, Sophie Mae
  b 08.09.1979
  Sophie b. at Melbourne, Australia. She is a bursary student at Nga Tawa School, Marton and is
  sitting performance letters in flute. She is presently spending time in the UK before returning to
  Auckland University.
  04> LUDBROOK, Amy Rose
  b 08.02.1982
  Amy b. at Melbourne, Australia. She was a student at Nga Tawa School, Marton (1995-97) and is now
  at St Paul's Collegiate in Hamilton,
